fn main() {
    let mut scores: Vec<u64> = Vec::new();
    'outer: for line in INPUT {
        let mut stack: Vec<char> = Vec::new();
        for c in line.chars() {
            match c {
                '(' => stack.push(c),
                '[' => stack.push(c),
                '{' => stack.push(c),
                '<' => stack.push(c),
                _ => {}
            }
            let corrupted = !match c {
                ')' => pop_stack('(', &mut stack),
                ']' => pop_stack('[', &mut stack),
                '}' => pop_stack('{', &mut stack),
                '>' => pop_stack('<', &mut stack),
                _ => true,
            };
            if corrupted {
                continue 'outer;
            }
        }
        let mut score: u64 = 0;
        let mut add_score = |v: u64| score = (score * 5) + v;
        for c in stack.iter().rev() {
            match c {
                '(' => add_score(1),
                '[' => add_score(2),
                '{' => add_score(3),
                '<' => add_score(4),
                _ => {}
            }
        }
        scores.push(score);
    }
    scores.sort();
    println!("{:?}", scores[scores.len() / 2]);
}

fn pop_stack(c: char, stack: &mut Vec<char>) -> bool {
    match stack.pop() {
        Some(popped) => popped == c,
        None => false,
    }
}

